import React, { useEffect } from "react";
import { Jumbotron, Button } from 'reactstrap';

function Reports() {

    const [rep, setRep] = useState('')

    useEffect(() => {
        fetch(`mongodb+srv://alena1990:<password>@cluster0.cxb5s.mongodb.net/myFirstDatabase?retryWrites=true&w=majority`)
        .then(res => res.json())
        .then(result => {
            setRep(rep)
        });
    }, [])
    
    return <div className="container">
        <Jumbotron>
            <h1 className="display-3">Report Page</h1>
            <p className="lead">This is a simple hero unit, a simple Jumbotron-style component for calling extra attention to featured content or information.</p>
            <hr className="my-2" />
            <p>It uses utility classes for typography and spacing to space content out within the larger container.</p>
            <p className="lead">
                <Button color="primary">Resolve</Button>
            </p>
            <p className="lead">
                <Button color="danger">Block</Button>
            </p>
        </Jumbotron>

    </div>
}

export default Reports;
